import React,{Component} from 'react';
import Image from 'react-bootstrap/Image';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

class Home extends Component{
    render(){
        return(
            <div>
            <Container className="mt-5 pb-5">
                <Row>
                    <Col md={4}>
                        <Image src={require('../assets/download.jpg')} rounded className="myphoto" />
                    </Col>
                    <Col md={8}>
                        <h3 className="mt-5 pt-4">Hi,I am</h3>
                        <h2 className="mb-4">Ivan Andi</h2>
                        <h3 className="jobtitle">Full Stack Web Developer</h3>
                    </Col>
                </Row>  
            </Container>
                <div style={{backgroundColor:"#343A40",padding:"3px",marginTop:"10px"}} className="ido">
                <Container>
                <h1 style={{color:"#6DD5FA"}} className="activity">What I Do</h1>
                    <i className="fa fa-code" aria-hidden="true"></i>
                    <h3 style={{color:"white"}} className="activity">Software Development</h3>
                    <p className="activity" style={{color:"white"}}>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s</p>    
                </Container>
                   
                </div>
            </div>
        );
    }
}

export default Home;
